drop table if exists HomeStadium;
drop table if exists GoalDifference;
drop table if exists GetSponsor;
drop table if exists GetAward;
drop table if exists Score;
drop table if exists Stadium;
drop table if exists TeamPoint;
drop table if exists Play;
drop table if exists Matches;
drop table if exists Team;
drop table if exists HeadReferee;
drop table if exists Award;
drop table if exists Main_SponsorShip;
drop table if exists City;
drop table if exists Employee;

CREATE TABLE Employee(
   EmployeeID    INTEGER NOT NULL PRIMARY KEY 
  ,nationality   VARCHAR(50) NOT NULL
  ,name          VARCHAR(50) NOT NULL
  ,age           INTEGER NOT NULL
  ,Team_name     VARCHAR(20) NOT NULL
  ,Employee_Type VARCHAR(10) NOT NULL
  ,position      VARCHAR(20)
  ,appearances   INTEGER 
  ,goals         INTEGER 
  ,assists       INTEGER 
  ,minutes_play  INTEGER 
);

CREATE TABLE City(
   city                          VARCHAR(50) NOT NULL PRIMARY KEY
  ,Population                    INTEGER  NOT NULL
  ,Number_of_Premier_league_team INTEGER  NOT NULL
);

CREATE TABLE Main_SponsorShip(
   SponsorshipID INTEGER  NOT NULL PRIMARY KEY 
  ,Sponsor_Name  VARCHAR(20) NOT NULL
);

CREATE TABLE Award(
   AwardID   INTEGER NOT NULL PRIMARY KEY 
  ,AwardName VARCHAR(50) NOT NULL
);

CREATE TABLE HeadReferee(
   RefereeID         INTEGER NOT NULL PRIMARY KEY 
  ,Name              VARCHAR(50) NOT NULL
  ,Date_of_birth     VARCHAR(20) NOT NULL
  ,Nationality       VARCHAR(20) NOT NULL
  ,Number_of_Matches INTEGER  NOT NULL
  ,red               INTEGER  NOT NULL
  ,yellow            INTEGER  NOT NULL
);


CREATE TABLE Team(
   Name          VARCHAR(20) NOT NULL PRIMARY KEY
  ,Win           INTEGER  NOT NULL
  ,Draw          INTEGER  NOT NULL
  ,Lost          INTEGER  NOT NULL
  ,Goal          INTEGER  NOT NULL
  ,Concede       INTEGER  NOT NULL
  ,City_Name     VARCHAR(50) NOT NULL REFERENCES City(city)
  ,SponsorshipID INTEGER  NOT NULL REFERENCES Main_Sponsorship(SponsorshipID)
);

CREATE TABLE Matches(
   MatchID          INTEGER  NOT NULL PRIMARY KEY 
  ,Match_Day_Number INTEGER  NOT NULL
  ,Home_Team        VARCHAR(20) NOT NULL 
  ,AwayTeam         VARCHAR(20) NOT NULL 
  ,RefID            INTEGER  NOT NULL REFERENCES HeadReferee(RefereeID)
  ,Attendance       INTEGER  NOT NULL
);

CREATE TABLE Play(
   MatchID   INTEGER  NOT NULL REFERENCES Matches(MatchID)
  ,Team_name VARCHAR(20) NOT NULL REFERENCES Team(Name)
  ,PRIMARY KEY(MatchID,Team_name)
);

CREATE TABLE TeamPoint(
   Win   INTEGER  NOT NULL 
  ,Draw  INTEGER  NOT NULL 
  ,Lost  INTEGER  NOT NULL 
  ,Point INTEGER  NOT NULL
  ,PRIMARY KEY(Win,Draw,Lost)
);

CREATE TABLE Stadium(
   Stadium_ID    INTEGER  NOT NULL PRIMARY KEY 
  ,Team_Name     VARCHAR(50) 
  ,Capacity      INTEGER  NOT NULL
  ,City          VARCHAR(50) 
  ,Confederation VARCHAR(50) NOT NULL
);


CREATE TABLE Score(
   Home_Team VARCHAR(20) NOT NULL 
  ,AwayTeam  VARCHAR(20) NOT NULL 
  ,Score     VARCHAR(10) NOT NULL
  ,PRIMARY KEY(Home_Team,AwayTeam)
);

CREATE TABLE GetAward(
   AwardID    INTEGER  NOT NULL REFERENCES Award(AwardID)
  ,EmployeeID INTEGER  NOT NULL REFERENCES Employee(EmployeeID)
  ,PRIMARY KEY(AwardID, EmployeeID)
);

CREATE TABLE GetSponsor(
   SponsorshipID INTEGER  NOT NULL REFERENCES Main_Sponsorship(SponsorshipID)
  ,Team_name     VARCHAR(20) NOT NULL REFERENCES Team(Name)
  ,amount        INTEGER NOT NULL
  ,PRIMARY KEY(SponsorshipID, Team_Name)
);

CREATE TABLE GoalDifference(
   Goal            INTEGER  NOT NULL  
  ,Concede         INTEGER  NOT NULL 
  ,Goal_Difference INTEGER  NOT NULL
  ,PRIMARY KEY(Goal, Concede)
);

CREATE TABLE HomeStadium(
   Home_team VARCHAR(20) NOT NULL REFERENCES Team(name)
  ,StaID     INTEGER NOT NULL REFERENCES Stadium(Stadium_ID)
  ,PRIMARY KEY(Home_Team)
);





















